      fill="none"
      viewBox="0 0 5 5"
      style={{ width, height, ...style }}
      {...others}
    >
      <path fill="currentColor" d="M0 2.5a2.5 2.5 0 115 0 2.5 2.5 0 01-5 0z" />
    </svg>
  );
}
